from collections import defaultdict
from itertools import product
from typing import List


class Solution:
    #   runtime; 356ms, 50.95%
    #   memory; 102.1MB, 27.27%
    def findMaximumXOR0(self, nums):
        if nums is None or 0 == len(nums):
            return 0

        TRIE = lambda: defaultdict(TRIE)
        trie = TRIE()

        def insert(numStr, val):
            t = trie
            for n in numStr:
                t = t[n]
            t['val'] = val

        maxBitLen = len(bin(max(nums))[2:])
        for n in nums:
            bitNum = bin(n)[2:]
            bitNum = '0' * (maxBitLen - len(bitNum)) + bitNum
            insert(bitNum, n)

        maxNum = 0
        for n in nums:
            if 2 ** (maxBitLen - 1) & n == 0:
                continue
            revNode = trie
            for b in bin(n)[2:]:
                if b == '1':
                    if '0' in revNode:
                        revNode = revNode['0']
                    else:
                        revNode = revNode['1']
                elif b == '0':
                    if '1' in revNode:
                        revNode = revNode['1']
                    else:
                        revNode = revNode['0']
            maxNum = max(maxNum, n ^ revNode['val'])
        return maxNum

    #   https://leetcode.com/explore/challenge/card/september-leetcoding-challenge/556/week-3-september-15th-september-21st/3462
    #   Time Limit Exceeded
    def findMaximumXOR1(self, nums: List[int]) -> int:
        maxBits = [n for n in nums if len(bin(n)) == len(bin(max(nums)))]
        return max(n ^ maxBit for maxBit in maxBits for n in nums)

    #   Time Limit Exceeded
    def findMaximumXOR2(self, nums: List[int]) -> int:
        if len(nums) < 2:
            return 0
        maxBinNum, d = bin(max(nums))[2:], {i: defaultdict(list) for i in range(32)}
        lenMaxBinNum = len(maxBinNum)
        for n in nums:
            binNum = bin(n)[2:]
            lenBinNum = len(binNum)
            if lenBinNum < lenMaxBinNum:
                binNum = '0' * (lenMaxBinNum - lenBinNum) + binNum
            for i, b in enumerate(binNum):
                d[lenMaxBinNum - i - 1][b].append(n)
        maxNum = nums[0]
        for i in range(31, -1, -1):
            if 0 < len(d[i]['0']) and 0 < len(d[i]['1']):
                maxNum = max(a ^ b for a, b in product(d[i]['0'], d[i]['1']))
                break
        return maxNum

    #   runtime; 5192ms
    #   memory; 15.6MB, 98.02%
    def findMaximumXOR(self, nums: List[int]) -> int:
        if len(nums) < 2:
            return 0
        maxBit, maxBits, others = 1 << len(bin(max(nums))[2:]) - 1, [], []
        for n in nums:
            if n & maxBit:
                maxBits.append(n)
            else:
                others.append(n)
        if 0 == len(others):
            return max(a ^ b for a, b in product(maxBits, maxBits))
        return max(a ^ b for a, b in product(maxBits, others))


